import React from 'react';
import './App.css';
import Navbar from './component/navbar/navbar';
import Main from './component/main/main';
import Content from './component/content/content';
import kelebihanPerusahaan from './component/kelebihan-perusahaan/kelebihan-perusahaan';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Main />
      <Content />
      <kelebihanPerusahaan />
    </div>
  );
}

export default App;
